Descriptions:
Male. Pale yellowish brown in color, head with obscure brownish marking, pronotum with a broad yellow stripe (
Fig. 1
). Tenth tergum deeply cleft, hemitergal lobes elongate, narrowly rounded at apex, bearing ribbed peg-like sensilla basiconica and trichoid sensilla (
Figs. 2–3
). Lateral stylets absent. Epiproct, large, bulbous, triangular in shape (
Figs. 4, 5
, 
10–13
). Ventral sclerite brown, strap-like, terminating in downturned spine in repose (
Figs. 4
, 
6–8
, 
12
); dorsal sclerite brown, terminating between two external patches of stout spinulae and continuing internally to form a coiled sac (
Figs. 6
, 
10–12, 14
); laterally covered by dense hairs (
Figs. 4–7
). Epiproct with a wide opening on dorsal surface located behind external paired patches of 6-7 spines each (
Figs. 6–9
) arising from two longitudinal membranous swellings; opening internally connected to a coiled sac with two basolateral patches of internal spines (
Fig. 15
). Female. Subgenital plate parabolic (
Fig. 16
). Egg. Typical of the 
Diploperlini
, oval shape, medially with raised ridge, cross section semicircular (
Fig. 17
). Chorion with visor-like extension covering collar (
Fig. 17
), chorion with dense punctations, visor coarsely punctate (
Fig. 17
).
